import React, { Component } from 'react'

export default class Reportes extends Component {
    render() {
        return (
            <div >
                <br></br>
                <div class="card col-md-6 offset-md-3 text-light bg-dark" >
                    <div class="card-body">
                    <button className="btn btn-outline-danger btn-lg  " > listar libros </button>
                    <br></br>
                    <button className="btn btn-outline-danger btn-lg  itemBoton" > listar usuarios </button>
                    </div>
                </div>
                
            </div>
        )
    }
}
